import React from 'react'
import ReactDOM from 'react-dom'
import PropTypes from 'prop-types'
import './index.css'
import 'font-awesome/css/font-awesome.min.css';



function CardListItem ( {files} ) {
    return (
        <div className="list">
            <div className="title">Phone Features </div>
            <div className="item">Subwoofer </div>
            <div className="item">Wings </div>
        </div>
    )
}

                /* {testCards.map(testCard => (
                    <CardListItem key={testCard} />
                ))} */

CardListItem.propTypes = {
    files: PropTypes.array
}


const testCards = [ 
    'Subwoofer', 'Non-porous, washable', 'Wings', 'Beveled Bezel'
];



